    NONFAILING(*(uint8_t*)0x200000ccb004 = 0xac);
    NONFAILING(*(uint8_t*)0x200000ccb005 = 0x14);
    NONFAILING(*(uint8_t*)0x200000ccb006 = 0x14);
    NONFAILING(*(uint8_t*)0x200000ccb007 = 0xaa);
